import React, { Component, Fragment } from 'react';
import mountains from '../../images/moutains.jpeg';
import { MarqueeImage } from './Marquee.styled.js';

class Marquee extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <Fragment>
        <br />
        <br />
        <br />
        <br />
        <MarqueeImage>
          <img src={mountains} />
        </MarqueeImage>
      </Fragment>
    );
  }
}

export default Marquee;
